pub enum Cw3ExecuteMsg<T = Empty> where T: Clone + fmt::Debug + PartialEq +
         JsonSchema {
    Propose {
        title: String,
        description: String,
        msgs: Vec<CosmosMsg<T>>,
        earliest: Option<Expiration>,
        latest: Option<Expiration>,
    },
    Vote {
        proposal_id: u64,
        vote: Vote,
    },
    Execute {
        proposal_id: u64,
    },
    Close {
        proposal_id: u64,
    },
}

pub enum Cw3QueryMsg {
    Threshold {
    },
    Proposal {
        proposal_id: u64,
    },
    ListProposals {
        start_after: Option<u64>,
        limit: Option<u32>,
    },
    ReverseProposals {
        start_before: Option<u64>,
        limit: Option<u32>,
    },
    Vote {
        proposal_id: u64,
        voter: String,
    },
    ListVotes {
        proposal_id: u64,
        start_after: Option<String>,
        limit: Option<u32>,
    },
    Voter {
        address: String,
    },
    ListVoters {
        start_after: Option<String>,
        limit: Option<u32>,
    },
}

pub enum ThresholdResponse {
    AbsoluteCount {
        weight: u64,
        total_weight: u64,
    },
    AbsolutePercentage {
        percentage: Decimal,
        total_weight: u64,
    },
    ThresholdQuorum {
        threshold: Decimal,
        quorum: Decimal,
        total_weight: u64,
    },
}
